#include "Std_Types.h"
#include "RBLCF_MemoryRemap.h"
#include "RBSYS_FSWStartup.h"


/** Startup Flow:
    1.) If DCF BCS_ADDR is not programmed, continue with 2.)
    2.) Do anything as configured in BCS
    3.) Search for Valid Boot Record
    4.) Jump to Core specific Reset Vector
*/



typedef struct {
  uint16 CPUEnableFlags;
  uint16 BootRecordTag; //< Valid Boot Record Tag is always 0xA55A
  uint32 ResetVectorCPU0;
  uint32 SecureBootSizeCPU0;
  uint32 ResetVectorCPU1;
  uint32 SecureBootSizeCPU1;
  uint32 ResetVectorCPU2;
  uint32 SecureBootSizeCPU2;
  uint32 ResetVectorCPU3;
  uint32 SecureBootSizeCPU3;
  uint32 ResetVectorCPU4;
  uint32 SecureBootSizeCPU4;
  uint32 ResetVectorCPU5;
  uint32 SecureBootSizeCPU5;
  uint32 reserved[3];
}RBSYS_BootRecord_t;

typedef struct{
  uint32 DCF_Part1[(32*1024-512)/4];   // Address: UTEST + 0x0000
  RBSYS_BootRecord_t rbsys_BootRecord; // Address: UTEST + 0x7E00
  uint32 DCF_Part3[(512-0x40)/4];      // Address: UTEST + 0x7E40
}RBSYS_FlashConfigurationArea_t;

static_assert(sizeof(RBSYS_FlashConfigurationArea_t) == 0x8000, "Size of DCF Area is invalid!");

#define RBSYS_CPUEnableFlags_StartCore0 ((uint16)(1u<<0))
#define RBSYS_SecureBootSize_Invalid (0u)


#define NO_STOPBIT (0x0)
#define DCF_CLIENT(Chipselect, Address, StopBit) (((uint32)(Chipselect&0xFFFFu)<<16) | ((uint32)(Address&0xFFFu)<<2) | (uint32)(StopBit&0x1u))

